import React from "react";
import Button from "@material-ui/core/Button";
import { NavLink } from "react-router-dom";

function Adoption() {
  return (
    <>
      <Button
        variant="contained"
        color="primary"
        to="/create-post"
        component={NavLink}
      >
        Post for adoption
      </Button>
    </>
  );
}

export default Adoption;
